     const { data } = await axios.get("https://jsonplaceholder.typicode.com/users") 
       setUsers(data) 
       console.log(data)
    }
    useEffect (() => {   
        fetchUsers(); 
    }, []) 

    const pixels = "3px";

    return (
    <div style={{ border: `${pixels}px solid black` }}>
